import React from "react";
import "./Contact.css";

const Contact = () => {
  return (
    <div style={{ padding: "60px" }}>
      <h1>Contact Us</h1>
      <p>Email: support@shopper.com</p>
      <p>Phone: +91 9876543210</p>
      <p>Address: Bhopal, MP, India</p>
    </div>
  );
};

export default Contact;
